import React from 'react'
import { NavLink } from 'react-router-dom'

export const Navbar = () => {
    return (
        <nav className="navbar navbar-expand-lg navbar-dark bg-dark ">
            <div className="container-fluid">
                <a className="navbar-brand" href="#">MyBasket</a>
                <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                    <span className="navbar-toggler-icon"></span>
                </button>
                <div className="collapse navbar-collapse" id="navbarSupportedContent">
                    <ul className="navbar-nav me-auto mb-2 mb-lg-0">
                        <li className="nav-item">
                            <NavLink className="nav-link active" to='/'>Home</NavLink>
                            {/* <a className="nav-link active" aria-current="page" href="#">Home</a> */}
                        </li>
                        <li className="nav-item">
                            <a className="nav-link" href="#">MyCart</a>
                        </li>
                    </ul>
                    <form className="d-flex flex-row bg-dark" role="search">
                        <input className="form-control me-2" type="search" placeholder="Search" aria-label="Search" />
                        <button className="btn btn-outline-success" type="submit">Search</button>
                    </form>
                </div>
            </div>
        </nav>
        // <nav classNameName='primary-nav' style={{display:"flex"}}>
        //     <NavLink to='/'>Home</NavLink>
        //     <NavLink to='/about'>About</NavLink>
        //     <NavLink to='/products'>Products</NavLink>
        //     <input type='search' placeholder='Search for Products' style={{width:"350px", height:"0px"}}/>
        //     <button style={{padding:"0px",height:"25px",marginLeft:"10px"}}>Search</button>
        //     <NavLink to='/signup' style={{marginRight:"20px",justifyContent:"flex-end"}}>SignIN</NavLink>

        // </nav>
    )
}
